import React, { Component } from "react";

import { Dashboard as DashboardLayout } from "layouts";

import StudymaterialToolbar from "./components/StudymaterialToolbar";
import MaterialTable from "material-table";
import { SvgIconProps } from "@material-ui/core/SvgIcon";

import Search from "@material-ui/icons/Search";
import ViewColumn from "@material-ui/icons/ViewColumn";
import SaveAlt from "@material-ui/icons/SaveAlt";
import ChevronLeft from "@material-ui/icons/ChevronLeft";
import ChevronRight from "@material-ui/icons/ChevronRight";
import FirstPage from "@material-ui/icons/FirstPage";
import LastPage from "@material-ui/icons/LastPage";
import Add from "@material-ui/icons/Add";
import Check from "@material-ui/icons/Check";
import FilterList from "@material-ui/icons/FilterList";
import Remove from "@material-ui/icons/Remove";
import IconButton from "@material-ui/core/IconButton";
import CloseIcon from "@material-ui/icons/Close";
// styles
import styles from "./styles";
import { withStyles } from "@material-ui/styles";

class StudymaterialList extends Component {
	columns = [
		[
			{ title: "Adı", field: "name" },
			{ title: "Soyadı", field: "surname" },
			{ title: "Doğum Yılı", field: "birthYear", type: "numeric" },
			{
				title: "Doğum Yeri",
				field: "birthCity",
				lookup: { 34: "İstanbul", 63: "Şanlıurfa" }
			}
		]
	];

	data = [
		{ name: "RAchel", surname: "Baran", birthYear: 1987, birthCity: 23 },
		{ name: "Monica", surname: "Geller", birthYear: 1387, birthCity: 53 },
		{ name: "Ross", surname: "Geller", birthYear: 1687, birthCity: 63 },
		{ name: "Chandler", surname: "Bing", birthYear: 1187, birthCity: 13 },
		{ name: "Phoebe", surname: "No", birthYear: 1187, birthCity: 62 }
	];

	options = {
		filtering: true,
		search: true
	};

	render() {
		const { classes } = this.props;

		return (
			<DashboardLayout title="Studymaterial">
				<div className={classes.root}>
					<StudymaterialToolbar />
					<MaterialTable
						className={classes.content}
						columns={[
							{ title: "Adı", field: "name" },
							{ title: "Soyadı", field: "surname" },
							{ title: "Doğum Yılı", field: "birthYear", type: "numeric" },
							{
								title: "Doğum Yeri",
								field: "birthCity",
								lookup: { 34: "İstanbul", 63: "Şanlıurfa" }
							}
						]}
						data={[
							{
								name: "Mehmet",
								surname: "Baran",
								birthYear: 1987,
								birthCity: 63
							}
						]}
						title="Study Material List"
					/>
				</div>
			</DashboardLayout>
		);
	}
}

export default withStyles(styles)(StudymaterialList);
